import React,{useState} from 'react';
import { useDispatch } from 'react-redux';

const Form = () => {
    const [email, setEmail] = useState('');
    const [password, setPass] = useState('');
   
    const dispatch = useDispatch()
    // const {getLogin} = useSelector((state) => state.JobReducer)

    return (
        <div>
            <form>
                <div className="mb-3">
                    <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                    <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
                </div>
                <div className="mb-3">
                    <input type="password" className="form-control" id="exampleInputPassword1" />
                </div>
                <div className="mb-3 form-check">
                    <input type="checkbox" className="form-check-input" id="exampleCheck1" />
                    <label className="form-check-label" htmlFor="exampleCheck1">Check me out</label>
                </div>
                <div className="submit d-flex align-items-center">
                    <button type="submit" className="btn btn-danger me-3">Login</button>
                    or

                    <button type="submit" className="btn">Login With Google</button>
                </div>
            </form>
        </div>
    );
}

export default Form;
